  [],\n\t\"revision_timestamp\": \"2015-07-23T03:32:44.069808\",\n\t\"name\": \"distribution-and-abundance-of-breeding-birds-and-small-mammals-in-the-high-salt-marsh-and-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The primary objective of the study was
  to document breeding bird and small mammal distribution and abundance in the high
  salt marsh and the adjacent riparian zone during the summer of 1986.  A secondary
  objective was to explore preliminary riparian zone use guidelines that would enhance
  or at least maintain habitat for bird and mammal species found using these areas.Ten
  study areas were selected on five salt marshes and their adjacent riparian zones
  in the towns of Kennebunkport, Kennebunk, Wells, York, and Kittery.  All of these
  areas are part of Rachel Carson National Wildlife Refuge.  Study sites were selected
  because of habitat type, accessibility, and proximity to disturbance.\",\n\t\"license_title\":
